 !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"562720","type":"CustomJS"},{"attributes":{"active_drag":{"id":"562393"},"active_scroll":{"id":"562394"},"tools":[{"id":"562393"},{"id":"562394"},{"id":"562395"},{"id":"562396"},{"id":"562397"},{"id":"562398"},{"id":"562399"},{"id":"562422"},{"id":"562721"}]},"id":"562401","type":"Toolbar"},{"attributes":{},"id":"562786","type":"AllLabels"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"562354","type":"WheelZoomTool"},{"attributes":{"line_alpha":0.1,"line_color":"red","line_width":2,"x":{"field":"x"},"y":{"value":1.0}},"id":"562498","type":"Line"},{"attributes":{"days":["%d %b","%a %d"],"months":["%m/%Y","%b'%y"]},"id":"562374","type":"DatetimeTickFormatter"},{"attributes":{},"id":"562350","type":"BasicTicker"},{"attributes":{},"id":"562525","type":"DataRange1d"},{"attributes":{"axis_label":"Volume","coordinates":null,"formatter":{"id":"562615"},"gr
